function displayDataObjects(dataCollection) {
    // Iterate through each data object in the collection
    dataCollection.forEach((dataObject) => {


        var jour = dataObject.jour;
        //console.log(jour);
        var tabTest = document.querySelector(`#dateList li[ID-tab="${jour}"]`);
        //console.log(tabTest);
        if (!tabTest) {
            var DateDay = new Date(dataObject.DateDay);
            const list = document.getElementById('dateList');
            // Create the new list item
            var li = document.createElement('li');
            li.setAttribute('ID-tab', jour);
            li.setAttribute('data-date', DateDay);
            li.setAttribute('onclick', "changeSelectedDay(this)");
            li.setAttribute('data-link', '#section-services-tab');
            li.innerHTML = `
          <h3>Jour <span></span></h3>
          <h4>${DateDay.toLocaleDateString()}</h4>
          <i class="fa-solid fa-trash" onclick="removeDate(this)"></i>`;
            const contentContainer = document.querySelector('.de_tab_content');

            // Create the new tab content section
            var contentSection = document.createElement('div');
            contentSection.id = 'tab' + jour;
            contentSection.className = 'tab_single_content';

            contentSection.innerHTML = '<div class="row"><div class="col-md-12"><div class="schedule-listing"></div></div></div>';

            contentContainer.appendChild(contentSection);


            list.appendChild(li);

        }//end if

        var SLidTab = document.querySelector("#tab" + jour + ' .schedule-listing');
        var IPhourd = dataObject.hourd;
        var IPhourf = dataObject.hourf;
        var IPjour = dataObject.jour;
        var IPtitre = dataObject.titre;
        var IPorg = dataObject.org;
        var IPlieu = dataObject.lieu;
        var L_organisation_src = dataObject.L_organisation_src;
        var presentatorInfos = dataObject.presentatorInfos;
        var L_sponsor_src = dataObject.L_sponsor_src;


        var item1S = SLidTab.querySelector(`#tab` + jour + ` .schedule-item[p-date-d="${IPhourd}"]`);
        //console.log(item1S);

        var item2S = SLidTab.querySelector(`#tab` + jour + ` .schedule-item[p-date-f="${IPhourf}"]`);
        //console.log(item2S);



        if (!item1S || !item2S) {
            //console.log("ok1");
            ProgramConstruction(SLidTab, IPtitre, IPorg, IPjour, IPhourd, IPhourf, IPlieu, L_organisation_src, presentatorInfos, L_sponsor_src);
        }

        else if (SLidTab.querySelector("#tab" + jour + ` .schedule-item[p-date-d="${IPhourd}"][p-date-f="${IPhourf}"]`)) {
            //console.log("ok2");

            var scheduleItemListDiv = SLidTab.querySelector(`.schedule-item[p-date-d="${IPhourd}"]   .schedule-item-list`);


            var scheduleItemListProgDiv = createAndAppendElement('div', scheduleItemListDiv, 'schedule-item-list-prog', null, 'onclick', 'UpdateProgramInformation(this)', "data-bs-toggle", "modal", "data-bs-target", "#ScheduleItemModal");
            // Trainers container
            var trainersDiv = createAndAppendElement('div', scheduleItemListProgDiv, 'trainers');
            createAndAppendElement('p', trainersDiv, 'schedule-item-list-prog-title', 'Présenté par');

            presentatorInfos.forEach(info => {
                var DivTrainer = document.createElement("div");
                DivTrainer.className = "trainer";

                createTrainer(info.imgSrc, info.name, info.post, DivTrainer);
                trainersDiv.appendChild(DivTrainer);
            });

            // Sponsors
            var sponsorsDiv = createAndAppendElement('div', trainersDiv, 'sponsors');
            createAndAppendElement('p', sponsorsDiv, null, 'Sponsoré par');
            L_sponsor_src.forEach(sponsorSrc => {
                createAndAppendElement('img', sponsorsDiv, null, null).src = sponsorSrc;
            });
            createAndAppendElement('p', trainersDiv, 'place', IPlieu);



            // Workshop title
            var scTitleDiv = createAndAppendElement('div', scheduleItemListProgDiv, 'sc-title');
            createAndAppendElement('p', scTitleDiv, 'schedule-item-list-prog-title', IPorg);
            createAndAppendElement('h3', scTitleDiv, null, IPtitre);
            L_organisation_src.forEach(logosrc => {
                createAndAppendElement('img', scTitleDiv).src = logosrc;

            });

















        }



    });
    var tab1S = document.querySelector('#dateList li[ID-tab="1"]');
    if (tab1S) {
        tab1S.classList.add('active');
    }

}

