function StartProgram(dataCollection) {
    document.getElementById('dateList').innerText = '';
    document.querySelector(".de_tab_content").innerText = '';
    Object.entries(dataCollection).forEach(([key, value]) => {
        var contentSection = document.querySelector(".de_tab_content");
        //console.log(dataCollection[key][0]["DateDay"]);
        var DateDay = new Date(dataCollection[key][0]["DateDay"]);
        var li = document.createElement('li');
        li.setAttribute('ID-tab', key);
        li.setAttribute('data-date', dataCollection[key][0]["DateDay"]);
        li.setAttribute('onclick', "changeSelectedDay(this)");
        li.setAttribute('data-link', '#section-services-tab');
        li.innerHTML = `
        <h3>Jour <span>${key}</span></h3>
        <h4>${DateDay.toLocaleDateString()}</h4>
        <i class="fa-solid fa-trash" onclick="removeDate(this)"></i>`;

        if (key === "1") {
            li.classList.add('active');
        }

        document.getElementById('dateList').appendChild(li);

        var divTab = document.createElement('div');
        divTab.id = 'tab' + key;
        divTab.className = 'tab_single_content';
        //divTab.style.display = 'block';

        var divRow = document.createElement('div');
        divRow.className = 'row';

        var divCol = document.createElement('div');
        divCol.className = 'col-md-12';

        var divschedule_listing = document.createElement('div');
        divschedule_listing.className = 'schedule-listing';

        divCol.appendChild(divschedule_listing);
        divRow.appendChild(divCol);
        divTab.appendChild(divRow);
        contentSection.appendChild(divTab);
        //console.log("-----------------------------");

        Array.from(value).forEach(vl => {
            if(!(vl.hourd =="" || vl.hourf =="")){
                var Sitem1CH = `.de_tab_content .schedule-item[p-date-d="${vl.hourd}"]`;
                var Sitem2CH = `.de_tab_content .schedule-item[p-date-f="${vl.hourf}"]`;
    
                var Sitem1 = document.querySelector(Sitem1CH);
                var Sitem2 = document.querySelector(Sitem2CH);
                //console.log(Sitem1);
                //console.log(Sitem2);
                var SLidTab = document.querySelector("#tab" + key + ' .schedule-listing');
                if (Sitem1 === null && Sitem2 === null) {
                    //console.log("jasser 1");
                    ProgramConstruction(SLidTab, vl.titre, vl.org, vl.jour, vl.hourd, vl.hourf, vl.lieu, vl.L_organisation_src, vl.presentatorInfos, vl.L_sponsor_src);
                } else if (Sitem1 !== null && Sitem2 !== null) {
                    //console.log("jasser 1023232");
    
                    var scheduleItemListDiv = SLidTab.querySelector(`.schedule-item[p-date-d="${vl.hourd}"]   .schedule-item-list`);
    
    
                    var scheduleItemListProgDiv = createAndAppendElement('div', scheduleItemListDiv, 'schedule-item-list-prog', null, 'onclick', 'UpdateProgramInformation(this)', "data-bs-toggle", "modal", "data-bs-target", "#ScheduleItemModal");
                    // Trainers container
                    var trainersDiv = createAndAppendElement('div', scheduleItemListProgDiv, 'trainers');
                    createAndAppendElement('p', trainersDiv, 'schedule-item-list-prog-title', 'Présenté par');
    
                    vl.presentatorInfos.forEach(info => {
                        var DivTrainer = document.createElement("div");
                        DivTrainer.className = "trainer";
    
                        createTrainer(info.imgSrc, info.name, info.post, DivTrainer);
                        trainersDiv.appendChild(DivTrainer);
                    });
    
                    // Sponsors
                    var sponsorsDiv = createAndAppendElement('div', trainersDiv, 'sponsors');
                    createAndAppendElement('p', sponsorsDiv, null, 'Sponsoré par');
                    vl.L_sponsor_src.forEach(sponsorSrc => {
                        createAndAppendElement('img', sponsorsDiv, null, null).src = sponsorSrc;
                    });
                    createAndAppendElement('p', trainersDiv, 'place', vl.lieu);
    
    
    
                    // Workshop title
                    var scTitleDiv = createAndAppendElement('div', scheduleItemListProgDiv, 'sc-title');
                    createAndAppendElement('p', scTitleDiv, 'schedule-item-list-prog-title', vl.org);
                    createAndAppendElement('h3', scTitleDiv, null, vl.titre);
                    vl.L_organisation_src.forEach(logosrc => {
                        createAndAppendElement('img', scTitleDiv).src = logosrc;
    
                    });
                }
            }//end if 


        });
    });



    if (document.getElementById(`tab1`)) {
        var AllContentContainerItems = document.querySelectorAll(`.tab_single_content`);
        AllContentContainerItems.forEach((elm) => {
            elm.style.display = "none"; // Corrected from 'elm.style.display === "none";'
        });
        document.getElementById(`tab1`).style.display = "block";
    }
}





